import React from "react";


const Footer = () => {
    return ( 
        <>
        <footer className="bg-[#71AC57]  z-10">
            <div className=" flex w-full h-36">
                <p className=" text-white"> Write to us <span>Nasz e-mail</span></p>
                <img className=" bg-cover h-[100px] w-[100px]" src="./github.png" alt="" />
            </div>
        </footer>
        </>
     );
}
 
export default Footer;
